import React from 'react';
import {Link} from '../routes';
import {Menu} from 'semantic-ui-react';

export default (props) => {
    return (
        <div>
            <Menu style={{marginTop: '10px'}}>
                <Link route="/">
                    <a className="item">
                    CrowdCoin
                    </a>
                </Link>
                <Menu.Menu position="right">
                  <Menu.Item>
                      Campaigns
                  </Menu.Item>
                  <Menu.Item>
                      +
                  </Menu.Item>
                </Menu.Menu>
            </Menu>
            {props.children}            
        </div>
    );
};
